import React from 'react';

function LeftSidebar({ categories, onKeywordClick }) {
  return (
    <div className="left-sidebar">
      <h3>Keywords</h3>
      {Object.keys(categories).map((category) => (
        <div key={category}>
          <h4>{category}</h4>
          <ul>
            {categories[category].map((keyword) => (
              <li key={keyword}>
                <button onClick={() => onKeywordClick(keyword)}>
                  {keyword}
                </button>
              </li>
            ))}
          </ul>
        </div>
      ))}
    </div>
  );
}

export default LeftSidebar;
